(43, 'Gud aman aja sih, buat accessibility lokasinya gada masalah, masih area pusat kota jadi aku ga perlu ngemaps', 'ud aman aja sih accessibility lokasi gada area pusat kota ga ngemaps', 'Cukup loss, pas kesini lagi sepi jadi ga puyeng buat parkirnya', 'ukup loss pas kesini sepi ga puyeng parkir', 'Cukup bersih dan nyaman aja sih kalo menurutku, mungkin yang agak mengganggu buat pelayannya bisa pake masker aja, biar kalo batuk pas di kitchen ga bikin waswas sama makanannya ', 'ukup bersih nyaman aja sih kalo turut mungkin agak ganggu layan pake masker aja biar kalo batuk pas kitchen ga bikin waswas makan', 'Konsepnya ala ala resto fast food jadul amerika, 80s-90s rekomen buat anak muda. Waiters ramah dan solutif, penyajian agak lama but still okay for me', 'onsepnya ala ala resto fast food jadul amerika s s rekomen anak muda aiters ramah solutif saji agak but still okay for me', '5/5⭐️ rasa enakk kualitas daging juga okee, buat porsi sama harga sebenernya bit overpriced tapi buat sekedar nyoba masi okee lah', 'enakk kualitas daging okee porsi harga sebenernya bit overpriced nyoba mas okee', 'Kanaya Pinastika', '2023-09-24 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Cukup Puas', 'Puas', 'Sangat Puas'),
(44, 'standart sihh, karena dia tengah kota jadi jalan yg bisa diakses juga bukan jalan yg ribet sempit, standart jalanan di tengah kota lah, oke', 'standart sihh kota jalan akses jalan ribet sempit standart jalan kota oke', 'selama kesana oke oke aja sih, paling kesulitan dikit klok lagi rame', 'kesana oke oke aja sih sulit dikit klok rame', 'semua spot di sana bersih banget jujur, jadinya nyaman seh kalok kesana dan emng kesannya yg bersih be e ya, jadi oke banget', 'spot bersih banget jujur nyaman seh kalok kesana emng kesan bersih be e oke banget', 'ramah banget, terus karena dibawah nama menunya juga dikasih desc itu apaan jadi memudahkan banget seh buat kita kalok mau milih makanan/minuman', 'ramah banget bawah nama menu kasih desc apa mudah banget seh kalok milih makan minum', 'sesuai sih sama harganya, walopun agak pricey buat kaum mahasiswa mendang-mending, tapi sesekali okelahhh', 'sih harga walopun agak pricey kaum mahasiswa dang mending okelahhh', 'rasyid', '2023-09-24 00:00:00', 'Puas', 'Puas', 'Puas', 'Puas', 'Puas'),
(45, 'Lokasi yang ditanya cukup mudah diakses oleh kendaraan karena lokasinya di tepi jalan', 'okasi tanya mudah akses kendara lokasi tepi jalan', 'Lokasi tempat yang ditanya memiliki tempat parkir yang cukup baik ', 'okasi tanya milik parkir', 'Tempat memiliki kebersihan yang cukup memuaskan, baik itu dari segi area customer atau tempat pemesanan', 'empat milik bersih muas segi area customer mesan', 'Tempat yang ditanya memiliki segi pelayanan yang cukup baik, baik dari aspek keramahan atau product knowledge yang didapat', 'empat tanya milik segi layan aspek ramah product knowledge dapat', 'Tempat yang ditanya memiliki segi kualitas produk yang cukup baik, misalnya dari segi rasa dan besaran porsi', 'empat tanya milik segi kualitas produk segi besar porsi', 'Bariq', '2023-09-24 00:00:00', 'Cukup Puas', 'Cukup Puas', 'Cukup Puas', 'Cukup Puas', 'Cukup Puas'),
(46, 'Gampang banget, jalan-jalannya juga nggak terlalu sempit, biasa aja.', 'ampang banget jalan jalan sempit aja', 'sejauh ini aman aja sih, gak pernah yg kesusahan gitu, mungkin karena pakek motor ya', 'aman aja sih gak susah mungkin pakek motor', 'bersih standart sih, pokok selama kesana gk pernah ada pikiran ni tempat gk bersih gitu lah', 'bersih standart sih pokok kesana gk pikir ni gk bersih', 'pelayannya ramah, menunya juga jelas ini apa itu apa, kecepaan penyajian standart restoran/cafe yg harus nyiapin masakannya dlu', 'layan ramah menu kecepaan saji standart restoran cafe nyiapin masakan dlu', 'gk murah tapi gk yang mahal banget (kecuali makanan) tapi cukup worth it sih, karena ya emng high quality juga', 'gk murah gk mahal banget makan worth it sih emng high quality', 'Noobnu', '2023-09-24 00:00:00', 'Puas', 'Puas', 'Puas', 'Puas', 'Puas'),
(47, 'Cukup mudah, karena jalanan menuju kesana tidak terlalu sempit', 'ukup mudah jalan tuju kesana sempit', 'cukup memadai untuk pengguna motor maupun mobil walaupun kalau sudah cukup padat pengunjung sedikit susah', 'pada guna motor mobil padat unjung susah', 'sangat terawat dan bersih, terutama ornamen dekorasi yang tertata dan terjaga rapi', 'awat bersih ornamen dekorasi tata jaga rapi', 'dari pelayanan sangat ramah dan cekatan serta dapat menjelaskan menu yang ada dengan baik. Untuk kecepatan penyajian meskipun dalam kondisi padat pengunjung, kecepatann penyajian tetap terjaga ', 'layan ramah cekat menu ntuk cepat saji meski dalam padat unjung kecepatann saji jaga', 'baik dari harga maupun porsi cukup sesuai dengan rasa yang disajikan sehingga bisa dikatakan secara keseluruhan memuaskan', 'harga porsi saji kata muas', 'aviel', '2023-09-24 00:00:00', 'Puas', 'Cukup Puas', 'Sangat Puas', 'Puas', 'Puas'),
(48, 'karena di tengah kota gtu jadi mudah-mudah aja sih akses kesana', 'kota gtu mudah mudah aja sih akses kesana', 'kadang agak susah nyarik tempat kalo lagi rame, tapi kalo sepi gampang-gampang aja sih', 'kadang agak susah nyarik kalo rame kalo sepi gampang gampang aja sih', 'tempatnya bersih banget, kayaknya debu juga gak ada sih disini, pokok bersih okelah', 'tempat bersih banget kayak debu gak sih sini pokok bersih oke', 'pegawainya ramah-ramah, terus sukanya dibawah nama menu udah ditulisin juga ini menu tuh apaan gitu, isinya apa juga, kalok cepetnya standart sih', 'pegawai ramah ramah suka bawah nama menu udah ditulisin menu tuh apa isi kalok cepetnya standart sih', 'agak pricey sih tapi karena emang bahan yang dipakek emang high quality sih, jadi yahh bisa diterima', 'agak pricey sih bahan dipakek high quality sih yahh terima', 'Hafizh', '2023-09-24 00:00:00', 'Puas', 'Cukup Puas', 'Puas', 'Puas', 'Puas'),
(49, 'aksesnya cukup mudah untuk menuju ke lokasi, orang surabaya maupun luar surabaya juga mudah untuk menuju ke lokasi', 'akses mudah tuju lokasi surabaya surabaya mudah tuju lokasi', 'Cukup puas, karena pelayanan juga oke dan keramahan juga oke mungkin kurangnya ada  disisi keluasan tempat karena untuk mobil menurut saya slot nya tidak banyak.', 'ukup puas layan oke ramah oke mungkin kurang sisi luas mobil slot nya', 'Menurut saya sudah sangat bersih karena sangat terlihat rapi dan bersih sehingga dapat menarik orang dgn kerapian dan kenyamanannya itu, mungkin ada beberapa jatuhan daun sedikit yg bikin terlihat agak berserakan', 'enurut bersih rapi bersih tarik dgn rapi nyaman mungkin jatuh daun bikin agak sera', 'Dari segi pelayanan juga saya sudah puas karena sudah dilayani dengan sebaik mungkin dan seramah mungkin.', 'ari segi layan puas layan mungkin ramah mungkin', 'Menurut saya agak worth it dengan harga menu segitu dengan kualitas makanan, kenikmatan dan ke estetika an', 'enurut agak worth it harga menu segitu kualitas makan nikmat estetika an', 'Abdiaz Faathir ', '2023-09-25 00:00:00', 'Cukup Puas', 'Cukup Puas', 'Puas', 'Puas', 'Cukup Puas');
