(50, 'akses lokasi gampang sih, deket juga dari sekitaran stasiun. ', 'akses lokasi gampang sih deket sekitar stasiun', 'space buat parkir oke, cuma kayaknya pas kesana lagi rush hour jadi agak crowded', 'space parkir oke kayak pas kesana rush hour agak crowded', 'belum nyoba toiletnya, tapi overall tempatnya bersih dan nyaman. mungkin saran buat pegawainya better pake masker', 'nyoba toilet overall tempat bersih nyaman mungkin saran pegawai better pake masker', 'agak lama dikit waktu penyajiannya, tapi pegawainya proper banget nyiapin pesenannya, ramah-ramah juga kalo kitanya ada perlu apa-apa', 'agak dikit saji pegawai proper banget nyiapin sen ramah ramah kalo kita', 'enak banget menurutku, cuma kalau pesen yang creamy gitu mungkin agak effort ngehabisinnya soalnya agak eneg. tapi dari segi kualitas dibandingin sama harga, sat&sun ini cukup worth to try', 'enak banget turut sen creamy mungkin agak effort ngehabisinnya agak eneg segi kualitas dibandingin harga sat sun worth to try', 'M. Habian Rajendra', '2023-09-25 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Puas', 'Puas', 'Sangat Puas'),
(51, 'amann, buat akses gampang kok. dia lokasinya bukan yang njelimet gitu jadi ini jadi tempat langganan kalo lagi pengen nongki bareng temen', 'amann akses gampang lokasi njelimet langgan kalo ken nongki bareng temen', 'spacious! aku ngga tau kalo lagi jam rame tapi beberapa kali aku kesana gaperna ngerasain issue soal tempat parkir', 'spacious ngga tau kalo jam rame kesana gaperna ngerasain issue parkir', 'bersih bangett, buat tempat makan sama area pemesanan bersih. cuma kalo buat kamar mandi aku belum pernah nyoba masuk, kata temen aku bersih aja cuma lampunya bikin pusing', 'bersih bangett makan area mesan bersih kalo kamar mandi nyoba masuk temen bersih aja lampu bikin pusing', 'staffnya super ramahh! love it, mereka solutif banget kalo ada problem, penanganannya oke banget lahh pokoknya, mungkin minusnya agak lama dikit waktu penyajiannya, tapi no big deal sih', 'staffnya super ramahh love it solutif banget kalo problem tangan oke banget lahh pokok mungkin minus agak dikit saji big deal sih', 'enakk! bcs aku tipikal yang suka makanan western tempat ini such a gem buat akuu, buat segi harga ini worth kok sama kualitas yang dikasi, porsinya juga ga pelit', 'enakk bcs tipikal suka makan western such a gem akuu segi harga worth kualitas kasi porsi ga pelit', 'Amaris Dianne Atmaja', '2023-09-25 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Puas', 'Sangat Puas'),
(52, 'puas dongg, aksesnya easy, mau kesini ramean juga ga masalah, bukan yang jalannya bikin riweuh pokoknya', 'puas dongg akses easy kesini ramean ga jalan bikin riweuh pokok', 'buat parkiran sih aman yaa, aku kesana ramean tapi masih banyak slot buat parkir, so I assume buat parkiran cukup spacious lah', 'parkir sih aman yaa kesana ramean slot parkir so assume parkir spacious', 'bersih euyy, nyaman juga jadinya buat nongki atau chill bareng doi/besti hehee, belum pernah nyobain toiletnya sih tapinya jadi gatau disitu bersih juga atau ngga', 'bersih euyy nyaman nongki chill bareng doi besti hehee nyobain toilet sih tapi gatau situ bersih ngga', 'ramahh bgt staffnya, cepet juga kok buat waktu penyajiannya, estetik juga soal plating makanan bikin appetite naikk hehee', 'ramahh bgt staffnya cepet saji estetik plating makan bikin appetite naikk hehee', 'puass pake bangett, buat rasa hit the spot poll, enak enak smua deh pokoknyaa. harga menurutku sebanding sama kualitas yang mereka kasii, ngga ngaco worth to try', 'puass pake bangett hit spot poll enak enak smua deh pokoknyaa harga turut banding kualitas kasi ngga ngaco worth to try', 'Dianne Karenina', '2023-09-25 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas'),
(53, 'aman, lokasi ga yang ribet masuk gang-gang, masih di area pusat kota jadi gaperlu susah gmaps', 'aman lokasi ga ribet masuk gang gang area pusat kota gaperlu susah gmaps', 'pas gw kesana lagi rame, effort dikit sih buat markir tapi itungannya masi oke aja ', 'pas gw kesana rame effort dikit sih markir itungannya mas oke aja', 'bersih bersih aja si menurut gw, gada masalah kecuali toiletnya. lampunya bikin puyeng parah, kurang nyaman aja ', 'bersih bersih aja si gw gada toilet lampu bikin puyeng parah nyaman aja', 'overall oke, konsep resto ala 90s american menurut gw cukup asik buat tempat nongki, pelayanan staffnya juga oke gada masalah, lama atau ngga nya mnurut gw si relatif, kalo mesen dish yang riweuh ya lama apalagi kalo rame', 'overall oke konsep resto ala s american gw asik nongki layan staffnya oke gada ngga nya mnurut gw si relatif kalo mesen dish riweuh kalo rame', 'buat rasa sama porsi  aman aja si, ga yang bikin komplain bcs gw tipikal yang suka western food jadinya have no problem soal rasa. harga menurut gw aman', 'porsi aman aja si ga bikin komplain bcs gw tipikal suka western food have problem harga gw aman', 'Gio Putra Danendra', '2023-09-25 00:00:00', 'Sangat Puas', 'Puas', 'Puas', 'Puas', 'Sangat Puas'),
(54, 'jalan cukup mudah diakses, ga nemuin kendala sih pas otw kesananya', 'jalan mudah akses ga nemuin kendala sih pas otw kesana', 'lahan parkir cukup luas, paling kalo lagi rush hour aja agak susah parkir, ', 'lahan parkir luas kalo rush hour aja agak susah parkir', 'okesih, bersih aja dari pertama kali kesini belum pernah nemuin issue soal kebersihan, mungkin kamar mandinya aja yg kurang enak lampunya', 'okesih bersih aja kesini nemuin issue bersih mungkin kamar mandi aja enak lampu', 'waitersnya oke aja, kalo ada kendala gercep juga nanganinnya. buat waktu penyajian menurutku gada masalah, ga yang lama parah tapi juga ga yang kilat banget', 'waitersnya oke aja kalo kendala gercep nanganinnya saji turut gada ga parah ga kilat banget', 'oke semua sih, soal rasa makanan semuanya yang aku pesen enak enak aja, bersih, dan masi fresh anget, buat harga emang bit pricey buat kantong mahasiswa, tapi kalo buat nyoba sekali doang ini worth to try', 'oke sih makan sen enak enak aja bersih mas fresh anget harga bit pricey kantong mahasiswa kalo nyoba doang worth to try', 'Prananta Abimana R', '2023-09-25 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas'),
(55, 'Akses ke sana emang gampang banget, karena tempatnya berada di pusat kota. Jadi, nggak perlu repot-repot pake maps dan nggak perlu kawatir bakal munyer-munyer', 'kses gampang banget tempat pusat kota adi repot repot pake maps kawatir munyer munyer', 'Tempat parkirnya luas banget, jadi kalo nggak lagi rame, parkir di sana nyaman dan aman. Nggak usah khawatir soal nyari tempat parkir', 'empat parkir luas banget kalo rame parkir nyaman aman ggak khawatir nyari parkir', 'okee bersih aja kokk menurutku, gada yang disturbing gitu soal kebersihan tempatnya, buat area kamar mandi aku cuma pernah foto tp ngga terlalu meratiin sih soal bersih nggak nya', 'okee bersih aja kokk turut gada disturbing bersih tempat area kamar mandi foto tp ngga meratiin sih bersih nya', 'Pelayanannya baik, mereka punya pengetahuan yang cukup tentang produk yang dijual. Meskipun ada sedikit waktu tunggu, kru di sana ramah banget! ', 'elayanannya tahu produk jual eskipun tunggu kru ramah banget', 'Harganya sebenarnya oke, terutama karena kualitas dagingnya memang bagus. Tapi, buat mahasiswa mungkin agak sedikit mahal. Rasa makanannya enak, tapi mungkin nggak se-\"ngebut\" itu. Bagi yang doyan makan, mungkin masih kurang untuk bikin ketagihan. ', 'arganya oke kualitas daging memang bagus api mahasiswa mungkin agak mahal asa makan enak mungkin ngebut agi doyan makan mungkin bikin tagih', 'Lamia Faradian', '2023-09-25 00:00:00', 'Sangat Puas', 'Sangat Puas', 'Puas', 'Sangat Puas', 'Sangat Puas'),
(56, 'Akses ke tempat ini benar-benar gampang. Lokasinya ada di tengah kota, jadi nggak perlu pusing cari-cari. Gampang nyampe sini, apalagi kalo udah familiar sama area sekitar.', 'kses benar benar gampang okasinya kota pusing cari cari ampang nyampe kalo udah familiar area', 'Tempat parkirnya luas banget. Gue pernah kesulitan nyari tempat parkir di tempat lain, tapi di sini enggak. Tempat parkirnya banyak, jadi nyaman aja buat parkir.', 'empat parkir luas banget ue sulit nyari parkir empat parkir nyaman aja parkir', 'Bersih banget, bro! Area buat pelanggan, toilet, dan bar semuanya terjaga kebersihannya dengan baik. Jadi, gue nyaman makan di sini.', 'ersih banget bro rea langgan toilet bar jaga bersih adi gue nyaman makan', 'Pelayan-pelayannya ramah dan punya pengetahuan tentang menu. Meskipun kadang ada antrian dan pelayanannya agak lama, tapi gue nggak keberatan. Mereka tetap ramah dan sabar.', 'elayan layan ramah tahu menu eskipun kadang antri layan agak gue berat ereka ramah sabar', 'Rasa makanannya enak banget, terutama dagingnya. Portion size-nya juga gede, jadi puas makan. Tapi, harus diakui, harganya agak mahal ya. Tapi buat kualitas yang gue dapetin, worth it lah.', 'asa makan enak banget daging ortion size nya gede puas makan api aku harga agak mahal api kualitas gue dapetin worth it', ' Alisha Rahmani', '2023-09-25 00:00:00', 'Puas', 'Sangat Puas', 'Sangat Puas', 'Sangat Puas', 'Puas'),
