(41, '2023-09-24 00:00:00', 'Denava Anindita', 'Sangat Puas', 'akses kesananya gampang, ada di pusat kota jugaa jadi gaperlu pusing gmapsnya', 'Sangat Puas', 'tempat parkir spacious, kalo ga lagi rame banget aman & enak aja soal parkirnya', 'Cukup Puas', 'buat kebersihan toilet sama area makannyaa all good, cuma panass banget?? toiletnya buat foto mayan instagramable cuma pusing gegara lampunya biru sinar uv', 'Puas', 'untuk pelayannya jelas, mereka paham product knowledgenya. Buat kecepatan penyajian pengalamanku kemarin agak lama tp masih acceptable, also the crew are so friendly!', 'Puas', 'harga yaa lumayan oke lah, bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. rasaa gudd tp bukan yang enakk buangett, agak eneg buat ngabisin makanannya'),
(42, '2023-09-24 00:00:00', 'Fafa', 'Cukup Puas', 'mudah, jalanannya juga yg gk sempit2 banget, standart lah', 'Cukup Puas', 'kalok buat motor fine aja sihh, kalok buat mobil kalok di high season gtu agak susah ya', 'Puas', 'bersih banget kyak jarang banget liat ada kotoran gtu di sini, kalokpun ada tuh pegawainya langsung gercep bersiin', 'Puas', 'lumayan lah yaaa, ramah, kalok kecepatan penyajian menurutku standart sih soalnya mrk juga masak dlu', 'Puas', 'high qualitynya keliatan sihh, cumannn buat ukuran mahasiswa yg mungkin mahasiswa yg agak mendang-mending ini cukup pricey tapi emng sebanding sm rasa dan besaran porsinya seh'),
(43, '2023-09-24 00:00:00', 'Kanaya Pinastika', 'Sangat Puas', 'Gud aman aja sih, buat accessibility lokasinya gada masalah, masih area pusat kota jadi aku ga perlu ngemaps', 'Sangat Puas', 'Cukup loss, pas kesini lagi sepi jadi ga puyeng buat parkirnya', 'Cukup Puas', 'Cukup bersih dan nyaman aja sih kalo menurutku, mungkin yang agak mengganggu buat pelayannya bisa pake masker aja, biar kalo batuk pas di kitchen ga bikin waswas sama makanannya ', 'Puas', 'Konsepnya ala ala resto fast food jadul amerika, 80s-90s rekomen buat anak muda. Waiters ramah dan solutif, penyajian agak lama but still okay for me', 'Sangat Puas', '5/5⭐️ rasa enakk kualitas daging juga okee, buat porsi sama harga sebenernya bit overpriced tapi buat sekedar nyoba masi okee lah'),
(44, '2023-09-24 00:00:00', 'rasyid', 'Puas', 'standart sihh, karena dia tengah kota jadi jalan yg bisa diakses juga bukan jalan yg ribet sempit, standart jalanan di tengah kota lah, oke', 'Puas', 'selama kesana oke oke aja sih, paling kesulitan dikit klok lagi rame', 'Puas', 'semua spot di sana bersih banget jujur, jadinya nyaman seh kalok kesana dan emng kesannya yg bersih be e ya, jadi oke banget', 'Puas', 'ramah banget, terus karena dibawah nama menunya juga dikasih desc itu apaan jadi memudahkan banget seh buat kita kalok mau milih makanan/minuman', 'Puas', 'sesuai sih sama harganya, walopun agak pricey buat kaum mahasiswa mendang-mending, tapi sesekali okelahhh'),
