(46, '2023-09-24 00:00:00', 'Noobnu', 'Puas', 'Gampang banget, jalan-jalannya juga nggak terlalu sempit, biasa aja.', 'Puas', 'sejauh ini aman aja sih, gak pernah yg kesusahan gitu, mungkin karena pakek motor ya', 'Puas', 'bersih standart sih, pokok selama kesana gk pernah ada pikiran ni tempat gk bersih gitu lah', 'Puas', 'pelayannya ramah, menunya juga jelas ini apa itu apa, kecepaan penyajian standart restoran/cafe yg harus nyiapin masakannya dlu', 'Puas', 'gk murah tapi gk yang mahal banget (kecuali makanan) tapi cukup worth it sih, karena ya emng high quality juga'),
(47, '2023-09-24 00:00:00', 'aviel', 'Puas', 'Cukup mudah, karena jalanan menuju kesana tidak terlalu sempit', 'Cukup Puas', 'cukup memadai untuk pengguna motor maupun mobil walaupun kalau sudah cukup padat pengunjung sedikit susah', 'Sangat Puas', 'sangat terawat dan bersih, terutama ornamen dekorasi yang tertata dan terjaga rapi', 'Puas', 'dari pelayanan sangat ramah dan cekatan serta dapat menjelaskan menu yang ada dengan baik. Untuk kecepatan penyajian meskipun dalam kondisi padat pengunjung, kecepatann penyajian tetap terjaga ', 'Puas', 'baik dari harga maupun porsi cukup sesuai dengan rasa yang disajikan sehingga bisa dikatakan secara keseluruhan memuaskan'),
(48, '2023-09-24 00:00:00', 'Hafizh', 'Puas', 'karena di tengah kota gtu jadi mudah-mudah aja sih akses kesana', 'Cukup Puas', 'kadang agak susah nyarik tempat kalo lagi rame, tapi kalo sepi gampang-gampang aja sih', 'Puas', 'tempatnya bersih banget, kayaknya debu juga gak ada sih disini, pokok bersih okelah', 'Puas', 'pegawainya ramah-ramah, terus sukanya dibawah nama menu udah ditulisin juga ini menu tuh apaan gitu, isinya apa juga, kalok cepetnya standart sih', 'Puas', 'agak pricey sih tapi karena emang bahan yang dipakek emang high quality sih, jadi yahh bisa diterima'),
(49, '2023-09-25 00:00:00', 'Abdiaz Faathir ', 'Cukup Puas', 'aksesnya cukup mudah untuk menuju ke lokasi, orang surabaya maupun luar surabaya juga mudah untuk menuju ke lokasi', 'Cukup Puas', 'Cukup puas, karena pelayanan juga oke dan keramahan juga oke mungkin kurangnya ada  disisi keluasan tempat karena untuk mobil menurut saya slot nya tidak banyak.', 'Puas', 'Menurut saya sudah sangat bersih karena sangat terlihat rapi dan bersih sehingga dapat menarik orang dgn kerapian dan kenyamanannya itu, mungkin ada beberapa jatuhan daun sedikit yg bikin terlihat agak berserakan', 'Puas', 'Dari segi pelayanan juga saya sudah puas karena sudah dilayani dengan sebaik mungkin dan seramah mungkin.', 'Cukup Puas', 'Menurut saya agak worth it dengan harga menu segitu dengan kualitas makanan, kenikmatan dan ke estetika an'),
(50, '2023-09-25 00:00:00', 'M. Habian Rajendra', 'Sangat Puas', 'akses lokasi gampang sih, deket juga dari sekitaran stasiun. ', 'Sangat Puas', 'space buat parkir oke, cuma kayaknya pas kesana lagi rush hour jadi agak crowded', 'Puas', 'belum nyoba toiletnya, tapi overall tempatnya bersih dan nyaman. mungkin saran buat pegawainya better pake masker', 'Puas', 'agak lama dikit waktu penyajiannya, tapi pegawainya proper banget nyiapin pesenannya, ramah-ramah juga kalo kitanya ada perlu apa-apa', 'Sangat Puas', 'enak banget menurutku, cuma kalau pesen yang creamy gitu mungkin agak effort ngehabisinnya soalnya agak eneg. tapi dari segi kualitas dibandingin sama harga, sat&sun ini cukup worth to try'),
(51, '2023-09-25 00:00:00', 'Amaris Dianne Atmaja', 'Sangat Puas', 'amann, buat akses gampang kok. dia lokasinya bukan yang njelimet gitu jadi ini jadi tempat langganan kalo lagi pengen nongki bareng temen', 'Sangat Puas', 'spacious! aku ngga tau kalo lagi jam rame tapi beberapa kali aku kesana gaperna ngerasain issue soal tempat parkir', 'Sangat Puas', 'bersih bangett, buat tempat makan sama area pemesanan bersih. cuma kalo buat kamar mandi aku belum pernah nyoba masuk, kata temen aku bersih aja cuma lampunya bikin pusing', 'Puas', 'staffnya super ramahh! love it, mereka solutif banget kalo ada problem, penanganannya oke banget lahh pokoknya, mungkin minusnya agak lama dikit waktu penyajiannya, tapi no big deal sih', 'Sangat Puas', 'enakk! bcs aku tipikal yang suka makanan western tempat ini such a gem buat akuu, buat segi harga ini worth kok sama kualitas yang dikasi, porsinya juga ga pelit'),
(52, '2023-09-25 00:00:00', 'Dianne Karenina', 'Sangat Puas', 'puas dongg, aksesnya easy, mau kesini ramean juga ga masalah, bukan yang jalannya bikin riweuh pokoknya', 'Sangat Puas', 'buat parkiran sih aman yaa, aku kesana ramean tapi masih banyak slot buat parkir, so I assume buat parkiran cukup spacious lah', 'Sangat Puas', 'bersih euyy, nyaman juga jadinya buat nongki atau chill bareng doi/besti hehee, belum pernah nyobain toiletnya sih tapinya jadi gatau disitu bersih juga atau ngga', 'Sangat Puas', 'ramahh bgt staffnya, cepet juga kok buat waktu penyajiannya, estetik juga soal plating makanan bikin appetite naikk hehee', 'Sangat Puas', 'puass pake bangett, buat rasa hit the spot poll, enak enak smua deh pokoknyaa. harga menurutku sebanding sama kualitas yang mereka kasii, ngga ngaco worth to try'),
(53, '2023-09-25 00:00:00', 'Gio Putra Danendra', 'Sangat Puas', 'aman, lokasi ga yang ribet masuk gang-gang, masih di area pusat kota jadi gaperlu susah gmaps', 'Puas', 'pas gw kesana lagi rame, effort dikit sih buat markir tapi itungannya masi oke aja ', 'Puas', 'bersih bersih aja si menurut gw, gada masalah kecuali toiletnya. lampunya bikin puyeng parah, kurang nyaman aja ', 'Puas', 'overall oke, konsep resto ala 90s american menurut gw cukup asik buat tempat nongki, pelayanan staffnya juga oke gada masalah, lama atau ngga nya mnurut gw si relatif, kalo mesen dish yang riweuh ya lama apalagi kalo rame', 'Sangat Puas', 'buat rasa sama porsi  aman aja si, ga yang bikin komplain bcs gw tipikal yang suka western food jadinya have no problem soal rasa. harga menurut gw aman'),
(54, '2023-09-25 00:00:00', 'Prananta Abimana R', 'Sangat Puas', 'jalan cukup mudah diakses, ga nemuin kendala sih pas otw kesananya', 'Sangat Puas', 'lahan parkir cukup luas, paling kalo lagi rush hour aja agak susah parkir, ', 'Sangat Puas', 'okesih, bersih aja dari pertama kali kesini belum pernah nemuin issue soal kebersihan, mungkin kamar mandinya aja yg kurang enak lampunya', 'Sangat Puas', 'waitersnya oke aja, kalo ada kendala gercep juga nanganinnya. buat waktu penyajian menurutku gada masalah, ga yang lama parah tapi juga ga yang kilat banget', 'Sangat Puas', 'oke semua sih, soal rasa makanan semuanya yang aku pesen enak enak aja, bersih, dan masi fresh anget, buat harga emang bit pricey buat kantong mahasiswa, tapi kalo buat nyoba sekali doang ini worth to try'),
(55, '2023-09-25 00:00:00', 'Lamia Faradian', 'Sangat Puas', 'Akses ke sana emang gampang banget, karena tempatnya berada di pusat kota. Jadi, nggak perlu repot-repot pake maps dan nggak perlu kawatir bakal munyer-munyer', 'Sangat Puas', 'Tempat parkirnya luas banget, jadi kalo nggak lagi rame, parkir di sana nyaman dan aman. Nggak usah khawatir soal nyari tempat parkir', 'Puas', 'okee bersih aja kokk menurutku, gada yang disturbing gitu soal kebersihan tempatnya, buat area kamar mandi aku cuma pernah foto tp ngga terlalu meratiin sih soal bersih nggak nya', 'Sangat Puas', 'Pelayanannya baik, mereka punya pengetahuan yang cukup tentang produk yang dijual. Meskipun ada sedikit waktu tunggu, kru di sana ramah banget! ', 'Sangat Puas', 'Harganya sebenarnya oke, terutama karena kualitas dagingnya memang bagus. Tapi, buat mahasiswa mungkin agak sedikit mahal. Rasa makanannya enak, tapi mungkin nggak se-\"ngebut\" itu. Bagi yang doyan makan, mungkin masih kurang untuk bikin ketagihan. '),
(56, '2023-09-25 00:00:00', ' Alisha Rahmani', 'Puas', 'Akses ke tempat ini benar-benar gampang. Lokasinya ada di tengah kota, jadi nggak perlu pusing cari-cari. Gampang nyampe sini, apalagi kalo udah familiar sama area sekitar.', 'Sangat Puas', 'Tempat parkirnya luas banget. Gue pernah kesulitan nyari tempat parkir di tempat lain, tapi di sini enggak. Tempat parkirnya banyak, jadi nyaman aja buat parkir.', 'Sangat Puas', 'Bersih banget, bro! Area buat pelanggan, toilet, dan bar semuanya terjaga kebersihannya dengan baik. Jadi, gue nyaman makan di sini.', 'Sangat Puas', 'Pelayan-pelayannya ramah dan punya pengetahuan tentang menu. Meskipun kadang ada antrian dan pelayanannya agak lama, tapi gue nggak keberatan. Mereka tetap ramah dan sabar.', 'Puas', 'Rasa makanannya enak banget, terutama dagingnya. Portion size-nya juga gede, jadi puas makan. Tapi, harus diakui, harganya agak mahal ya. Tapi buat kualitas yang gue dapetin, worth it lah.'),
(57, '2023-09-25 00:00:00', 'Zahra Fitriani', 'Sangat Puas', 'Gampang banget aksesnya ke sini. Lokasinya di tengah kota, jadi nggak perlu repot nyari-nyari. Bisa naik mobil atau angkutan umum, semua bisa.', 'Sangat Puas', 'Tempat parkirnya luas dan rapi. Saya datang pas lagi nggak rame, jadi nemu tempat parkir dengan mudah. ', 'Sangat Puas', 'Bersih banget di sini, dari area customer sampe toilet dan bar. Mereka beneran jaga kebersihan dengan baik, jadi nyaman buat makan dan ngobrol.', 'Sangat Puas', 'Pelayanannya ramah-ramah, mereka paham tentang menu. Meskipun kadang agak lama waktu pesan makanan karena rame, tapi mereka tetap sabar dan responsif.', 'Sangat Puas', 'Makanannya enak, terutama dagingnya. Portion-nya juga gede, jadi kenyang banget. Harga memang agak di atas rata-rata, tapi sebanding sama kualitasnya.'),
(58, '2023-09-25 00:00:00', 'Hana', 'Puas', 'karena di tengah kota kalik ya, jadi akses jalan kesana oke-oke aja dan memang sudah seharusnya begitu sihh', 'Cukup Puas', 'okelahh, sejauh ini belom menemukan kesulitan/hambatan yg berarti kalok markir di sana', 'Puas', 'bersih sihh, kayaknya malah gak mungkin gak sih kalok tempat makan yg udah nyewa tempat/bangunan gitu kotor??', 'Puas', 'mas/mbaknya ramah banget sehh, terus aku suka di sana tuh di bawah nama menunya dikasih keterangan ini makanan/minuman apa, kalok kecepatan standart sih', 'Puas', 'ENAK, burgernya juga isinya gak pelitt, cuma kalok dari aku gk mungkin sering kesana sih, soalnya cukup pricey ya untung makan/nongki sehari-hari, paling sebulan dua kali lahh oke '),
(59, '2023-09-25 00:00:00', 'Ali', 'Cukup Puas', 'gampang sih aksesnya kesana, mungkin karena dia di tengah kota ya', 'Cukup Puas', 'kayaknya standart parkiran kafe gitu sih, enak-enak aja, tapi kalok rame ya agak susah tapi b aja sih sejauh ini', 'Puas', 'selama disana gk pernah ada pikiran ni tempat kotor sih, malah bersih banget menurutku', 'Sangat Puas', 'sangat puas soalnya dikasih keterangan menunya itu contain apa aja, sukak sih, kalok kecepatan penyajian standart aja sih', 'Puas', 'porsinya okelah, rasanya juga enak, tapi worth it gk sama harganya, tergantung orangnya sih ya, buat aku worth it aja sih'),
(60, '2023-09-25 00:00:00', 'Rania Putriana', 'Puas', 'Akses buat ke lokasi aman ajaa, mnurutku karena masih di pusat ga susah buat kesananya', 'Puas', 'Puas aja, lahan parkirnya uda oke lah buat scale usaha segitu', 'Puas', 'Kebersihan amann, aku sih ga ada concern apa-apa soal hygine, blm nyoba masuk area toilet jadi gatau ', 'Puas', 'Pelayanannya awesome sihh, staffnya super baik dan friendly jugaa, makanan fresh from the ovenn juga cepet datengnyaa ', 'Sangat Puas', 'Enakk bangett. Porsi juga gaa pelit pokoknya buat makanan sm minumannya super gudd menurutku worth the price sih walaupun memang buat anak kosan gabisa sering sering'),
(61, '2023-09-25 00:00:00', 'Elvira Dewita', 'Sangat Puas', 'Gampang ajaa, jalannya bukan tipe yang neko-neko ala hidden gem gtu', 'Cukup Puas', 'Mungkin gara-gara aku kesananya siang jadi dia ramee bgt ampe sumpek lama nyari parkir, mnurutku agak effort tp tergantung kesananya jam brp si', 'Puas', 'Puas aja sih kalo aku, ga ada yg annoying dari segi kebersihan tempat, cuma kalo toiletnya aku belum tau sih gimana', 'Puas', 'Makanan sampenya agak lamaa sih cuma masih oke ajaa, maybe gara-gara kesana lagi pas rame, kalo soal pelayanan oke bangett staffnya baikk', 'Sangat Puas', 'Enakk dan worthy kokk, suka banget sama menu-menunya apalagi brisket, enak parahh, cuma yaa harganya mayan pricey jadi yaa gabisa ssring mampir'),
(62, '2023-09-25 00:00:00', 'Arkana Dwi Mahendra', 'Sangat Puas', 'akses kesananya gampang, ada di pusat kota jugaa jadi gaperlu pusing gmapsnya', 'Sangat Puas', 'Tempat parkir spacious, kalo ga lagi rame banget aman & enak aja soal parkirnya', 'Sangat Puas', 'Buat kebersihan toilet sama area makannyaa all good, cuma panass banget?? Toiletnya buat foto mayan instagramable ', 'Sangat Puas', 'Untuk pelayannya jelas, mereka paham product knowledgenya. Buat kecepatan penyajian pengalamanku kemarin agak lama tp masih acceptable, also the crew are so friendly!', 'Sangat Puas', 'Harga yaa lumayan oke lah, bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd lah bukan yg bikin nyesel gituu'),
(63, '2023-09-25 00:00:00', 'Sabrina Pratiningyas ', 'Sangat Puas', 'Okee aja, no big deal sih buat akses ke tempatnyaa, liat gmaps bntar aja cukup kalo uda apal jalan sby', 'Sangat Puas', 'Pas kesana lagi sepi jadi buat parkirannya aman aja sih, gatau lagi kalo pas rame, mungkin agak riweuh', 'Sangat Puas', 'Overall okee, bersih semua areanya, peralatan makan juga bersih jadi nyaman buat ngajak temen  or pasangan kesini', 'Sangat Puas', 'Staffnya oke banget sih, ramah ramah no salty, makanan juga standar aja kok waktu penyajiannya, ga yang lama banget ato gimana', 'Puas', 'Harga yaa lumayan oke lah, bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd tp bukan yang enakk buangett, agak eneg lama lama'),
(64, '2023-09-25 00:00:00', 'Laras Hayuningtyas Dwipadma', 'Puas', 'No issue, soal akses aman aja sihh, masi di pusat jadi yaa ga mumet pake gmaps', 'Sangat Puas', 'Cukup luas aman jugaa soal parkiran, mungkin kadang ada yg parkirnya kurang rapi aja jadi makan tempat', 'Sangat Puas', 'Beberapa kali kesini oke ajaa, aku ga nemuin masalah yang gimana gimana soal hygine nya', 'Sangat Puas', 'Oke bangett sih service yang dikasi staff nyaa, mereka pada ramahh n friendly, kecepatan penyajian juga menurutku okee, ga yg lama banget ga yg bentar banget jugaa', 'Sangat Puas', 'Mungkin krn aku suka makanan western jadi aku gada masalah sama makanannya, cuma kalo kata temenku ngabisinnya aga effort gara-gara eneg di akhir, tp overall oke sihh, porsi sm harga juga aman soalnya dagingnya enakk'),
(65, '2023-09-25 00:00:00', 'Amara Savielle Dewangga', 'Sangat Puas', 'akses kesananya gampang, ada di pusat kota jugaa jadi gaperlu pusing gmapsnya', 'Puas', 'Tempat parkir spacious, kalo ga lagi rame banget aman & enak aja soal parkirnya', 'Cukup Puas', 'Buat kebersihan toilet sama area makannyaa all good, cuma panass banget, ac nya ga ngaruh, toiletnya buat foto mayan instagramable cuma pusing gegara lampunya biru ', 'Puas', 'Untuk pelayannya jelas, mereka paham product knowledgenya. Buat kecepatan penyajian pengalamanku kemarin agak lama tp masih acceptable, also the crew are so friendly!', 'Cukup Puas', 'Yaa oke lah, harganya segitu bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd tp bukan yang enakk buangett, agak eneg buat ngabisin makanannya'),
(66, '2023-09-25 00:00:00', 'Dara Octaviana Zidane', 'Sangat Puas', 'Aman kokk, jalannya ga yang kecil atau masuk masuk gang gitu, dari kosanku juga deket jadi aman poll gampang', 'Sangat Puas', 'Kalo buat motor okee ae sih, yaa cukup aja asal ga lagi rame buanget ', 'Puas', 'Bersih poll area nde sini, aku ga ada masalah sih soal kebersihan e, agak oot tp mungkin keluhan e paleng rodok puyeng ae sama toilet nya', 'Sangat Puas', 'Soal service e sih aman juga gada masalahh, mungkin rodok lama ae makanannya sampe cuma mnurutku seh aman ga yg garai mangkel', 'Sangat Puas', 'Porsi okee sama rasanyaa wenakkpoll, must try poll yaa paleng emg buat harga rodok larang buat mahasiswa, kalo mau nyoba2 ae sih okee'),
(67, '2023-09-25 00:00:00', 'nadia', 'Cukup Puas', 'sat and sun mempunyai akses yang lumayan mudah dijangkau, jalan yang baik, dan oke ', 'Sangat Puas', 'parkir sat and sun mempunyai parkiran yang lumayan baik, mobil tidak kesusahan dalam mencari parkit', 'Sangat Puas', 'sat and sun mempunyai segi kebersihan yang baik, nyaman, wangi dan oke.  toilet bersih dan wangi', 'Sangat Puas', 'sat and sun mempunyai karyawan yang ramah, baik, dan sangat membantu customer, baik ketika ditanya ketika tidak mengerti', 'Puas', 'sat and sun dari segi  kualitas mempunyai makanan dan minuman yang oke, namun memang sedikit lebih mahal dibandingkan tempat lain'),
