(70, '2023-09-25 00:00:00', 'Iknadiya', 'Puas', 'Mudah di akses karena jalannya juga mudah dicari di gmaps', 'Puas', 'Parkirnya cukup baik dari segi penataan dan bantuan tukang parkir', 'Puas', 'Bersih tempatnya, barnya juga bersih, tempat duduknya juga bagus tatanannya, customer merasa senang ', 'Sangat Puas', 'Dadi segi pelayanan bagus karena penjual memberikan penjelasan terhadap produk jualnya yang tidak diketahui oleh customer', 'Puas', 'Untuk rasanya enak, porsinya cukup tidak terlalu sedikit dan tidak terlalu banyak dan untuk harganya terjangkau karena masih dapat dibeli oleh kalangan mahasiswa');
