(46, 'gk murah tapi gk yang mahal banget (kecuali makanan) tapi cukup worth it sih, karena ya emng high quality juga', 'gk murah gk mahal banget makan worth it sih emng high quality', 'Noobnu', '2023-09-24 00:00:00', 'Puas'),
(47, 'baik dari harga maupun porsi cukup sesuai dengan rasa yang disajikan sehingga bisa dikatakan secara keseluruhan memuaskan', 'harga porsi saji kata muas', 'aviel', '2023-09-24 00:00:00', 'Puas'),
(49, 'Menurut saya agak worth it dengan harga menu segitu dengan kualitas makanan, kenikmatan dan ke estetika an', 'enurut agak worth it harga menu segitu kualitas makan nikmat estetika an', 'Abdiaz Faathir ', '2023-09-25 00:00:00', 'Cukup Puas'),
