(60, 'Enakk bangett. Porsi juga gaa pelit pokoknya buat makanan sm minumannya super gudd menurutku worth the price sih walaupun memang buat anak kosan gabisa sering sering', 'nakk bangett orsi gaa pelit pokok makan sm minum super gudd turut worth price sih memang anak kosan gabisa', 'Rania Putriana', '2023-09-25 00:00:00', 'Sangat Puas'),
(63, 'Harga yaa lumayan oke lah, bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd tp bukan yang enakk buangett, agak eneg lama lama', 'arga yaa lumayan oke bcs emg daging good quality mahasiswa a bit overpriced asaa gudd tp enakk buangett agak eneg', 'Sabrina Pratiningyas ', '2023-09-25 00:00:00', 'Puas'),
(69, 'rasa, kualitas makanan dan minuman enak, emnyegarkan, tapi memang agak overprice, tp dapat dimengerti karna yaa tempatnya lucu', 'kualitas makan minum enak emnyegarkan memang agak overprice tp erti karna yaa tempat lucu', 'lina', '2023-09-25 00:00:00', 'Puas'),
