(53, 'buat rasa sama porsi  aman aja si, ga yang bikin komplain bcs gw tipikal yang suka western food jadinya have no problem soal rasa. harga menurut gw aman', 'porsi aman aja si ga bikin komplain bcs gw tipikal suka western food have problem harga gw aman', 'Gio Putra Danendra', '2023-09-25 00:00:00', 'Sangat Puas'),
(54, 'oke semua sih, soal rasa makanan semuanya yang aku pesen enak enak aja, bersih, dan masi fresh anget, buat harga emang bit pricey buat kantong mahasiswa, tapi kalo buat nyoba sekali doang ini worth to try', 'oke sih makan sen enak enak aja bersih mas fresh anget harga bit pricey kantong mahasiswa kalo nyoba doang worth to try', 'Prananta Abimana R', '2023-09-25 00:00:00', 'Sangat Puas'),
(56, 'Rasa makanannya enak banget, terutama dagingnya. Portion size-nya juga gede, jadi puas makan. Tapi, harus diakui, harganya agak mahal ya. Tapi buat kualitas yang gue dapetin, worth it lah.', 'asa makan enak banget daging ortion size nya gede puas makan api aku harga agak mahal api kualitas gue dapetin worth it', ' Alisha Rahmani', '2023-09-25 00:00:00', 'Puas'),
(57, 'Makanannya enak, terutama dagingnya. Portion-nya juga gede, jadi kenyang banget. Harga memang agak di atas rata-rata, tapi sebanding sama kualitasnya.', 'akan enak daging ortion nya gede kenyang banget arga memang agak banding kualitas', 'Zahra Fitriani', '2023-09-25 00:00:00', 'Sangat Puas'),
(58, 'ENAK, burgernya juga isinya gak pelitt, cuma kalok dari aku gk mungkin sering kesana sih, soalnya cukup pricey ya untung makan/nongki sehari-hari, paling sebulan dua kali lahh oke ', 'burgernya isi gak pelitt kalok gk mungkin kesana sih pricey untung makan nongki hari bulan lahh oke', 'Hana', '2023-09-25 00:00:00', 'Puas'),
(59, 'porsinya okelah, rasanya juga enak, tapi worth it gk sama harganya, tergantung orangnya sih ya, buat aku worth it aja sih', 'porsi oke enak worth it gk harga gantung orang sih worth it aja sih', 'Ali', '2023-09-25 00:00:00', 'Puas'),
(61, 'Enakk dan worthy kokk, suka banget sama menu-menunya apalagi brisket, enak parahh, cuma yaa harganya mayan pricey jadi yaa gabisa ssring mampir', 'nakk worthy kokk suka banget menu menu brisket enak parahh yaa harga mayan pricey yaa gabisa ssring mampir', 'Elvira Dewita', '2023-09-25 00:00:00', 'Sangat Puas'),
(62, 'Harga yaa lumayan oke lah, bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd lah bukan yg bikin nyesel gituu', 'arga yaa lumayan oke bcs emg daging good quality mahasiswa a bit overpriced asaa gudd bikin nyesel gituu', 'Arkana Dwi Mahendra', '2023-09-25 00:00:00', 'Sangat Puas'),
(64, 'Mungkin krn aku suka makanan western jadi aku gada masalah sama makanannya, cuma kalo kata temenku ngabisinnya aga effort gara-gara eneg di akhir, tp overall oke sihh, porsi sm harga juga aman soalnya dagingnya enakk', 'ungkin krn suka makan western gada makan kalo temenku ngabisinnya aga effort gara gara eneg tp overall oke sihh porsi sm harga aman daging enakk', 'Laras Hayuningtyas Dwipadma', '2023-09-25 00:00:00', 'Sangat Puas'),
(65, 'Yaa oke lah, harganya segitu bcs emg dagingnya good quality, cuma buat mahasiswa a bit overpriced. Rasaa gudd tp bukan yang enakk buangett, agak eneg buat ngabisin makanannya', 'aa oke harga segitu bcs emg daging good quality mahasiswa a bit overpriced asaa gudd tp enakk buangett agak eneg ngabisin makan', 'Amara Savielle Dewangga', '2023-09-25 00:00:00', 'Cukup Puas'),
