(68, 'kualitasnya makanan dan minuman baik, enak, namun emang dari segi harga agak overprice, tp understandable karna tempatnya yang lucu\n', 'kualitas makan minum enak segi harga agak overprice tp understandable karna tempat lucu', 'novia', '2023-09-25 00:00:00', 'Puas'),
